import React from "react";
import swapicon from "../components/icons/swapicon.png";

export default function CardBalance(props) {
  return (
    <div class="card" id="create-promise-outer">
      <div class="card" id="create-promise-asset"></div>
      <img src={swapicon} />
      <div class="card" id="create-promise-asset"></div>
    </div>
  );
}
